import React from 'react'
import { Icon } from 'semantic-ui-react'

 const Contacts = () => {
    return (
        <Icon.Group size='huge'>
            <Icon size='big' name='circle outline' />
            <Icon name='user' />
        </Icon.Group>
    )
}

export default Contacts
